import EditHouse from './EditHouse'

class EditProfile extends Component {
  constructor(props){
    super(props)
    this.state = {
      username: '',
      avatar: ''
    }
  }

  handleChange = (event) => {
    const {name, value, files} = event.target
    this.setState({
      house: {
        ...this.state.house,
      [name]: files && files ? files : value
